import React from 'react';
import ReactDOM from 'react-dom';

/**
 * 
 * @import_routes
 * 
 */
import App from './routes';


ReactDOM.render(
    <Router>
        <div>
            <App/>
        </div>
    </Router>, 
    document.getElementById("root")
    
)
